import React from "react";
import { Button as MuiButton } from "@mui/material";
import styles from "./styles/Button.module.css";

const CustomButton = ({ 
  onClick, 
  children, 
  variant = "primary",
  size = "medium",
  className = "",
  ...props
}) => {
  const buttonClasses = `${styles.button} ${styles[variant]} ${styles[size]} ${className}`;

  // Define button styles based on variant
  const buttonStyle = {
    backgroundColor: variant === "primary" ? "#0F0D46" : "transparent",
    color: variant === "primary" ? "#ffffff" : "#0F0D46",
    border: variant === "secondary" ? "1px solid #0F0D46" : "none",
    '&:hover': {
      backgroundColor: variant === "primary" ? "#0a0933" : "rgba(15, 13, 70, 0.04)",
    }
  };

  return (
    <MuiButton
      className={buttonClasses}
      onClick={onClick}
      variant={variant === "primary" ? "contained" : "outlined"}
      sx={buttonStyle}
      {...props}
    >
      {children}
    </MuiButton>
  );
};

export default CustomButton;
